const Home = () => {
    const handleClick = (e) => {
        console.log('hello peeps ', e);
    }

    const handleClickAgain = (name)=> {
        console.log('hello ' + name);
    }
    return ( 
        <div className="home">
            <h2>
                Homepage Content from Home.js
            </h2>
            <button onClick={handleClick}>Click me</button>
            <button onClick={()=>{handleClickAgain('steveO')}}>Click me again </button>
        </div>
     );
}
 
export default Home;
